(833, '07be9b22-9a79-4013-9367-7507b467aed2', 689, 'Y0079.pdf_6qPcdrUMGO.pdf', 'https://plan.alignrightlab.com/plan/Viewer/show.html?mlink=https://plan.alignrightlab.com/plan/Client4745/Y0079_Iheb%20Dhaouadi/CA6AFFBC5C22451F973CB0C1B6E1D3D2.iiwgl&fg=000&bg=fff&p=UVADLU', '<p>HI,</p><p>We have treated 5-5. We have resolved crowding , crossbite, and deepbite&nbsp;by adding&nbsp;ipr and expansion. However, we had to add 0.5mm of ipr in&nbsp;upper anteriors to maintain midline and overjet . Please consider the above scenarios and let us know if you feel any discrepancy in the setup.</p><p> Thankyou</p>', 0, 54, '2024-10-31 00:09:23', '2024-10-31 14:27:37'),
(834, '02056d46-588c-4749-8a1b-8ee4f16e69f5', 688, 'Y0078.pdf_gfAxB3Bbgg.pdf', 'https://plan.alignrightlab.com/plan/Viewer/show.html?mlink=https://plan.alignrightlab.com/plan/Client4745/Y0078-Chaieb%20Alaedine/2BAF1436AC1B42CCA979FEC1B7D27C99.iiwgl&fg=000&bg=fff&p=EEMUWD', '<p>hi,</p><p>We have done anterior alignment.&nbsp;Added ipr of 0.5mm in Q2 to maintain midline.&nbsp;Applied Anchorage attachments on molars . Added bite ramps on 13 and 23 instead of 32.&nbsp;</p><p>Maintained positive overjet as well. Please consider the above scenarios and let us know if you feel any discrepancy in the setup.</p><p> Thankyou</p>', 0, 54, '2024-10-31 00:10:07', '2024-10-31 14:28:26'),
